import React from 'react';
import './ResearchPage.css';

const researchProjects = [
  {
    id: 1,
    title: 'BEHAVIOR',
    description: 'BEHAVIOR is a benchmark in simulation where embodied AI agents need to plan and execute navigation and manipulation strategies based on sensor information to fulfill up to 1,000 household activities. BEHAVIOR tests the ability of agents to perceive the environment, plan, and execute complex long-horizon activities that involve multiple objects, rooms, and state changes, all with the reproducibility, safety, and observability offered by a realistic physics simulation.',
    imageUrl: process.env.PUBLIC_URL + 'svl_robot.jpg', // Replace with path to your image
    linkUrl: 'https://www.google.com',
  },
  // ... more projects
  {
    id: 2,
    title: 'BEHAVIOR',
    description: 'BEHAVIOR is a benchmark in simulation where embodied AI agents need to plan and execute navigation and manipulation strategies based on sensor information to fulfill up to 1,000 household activities. BEHAVIOR tests the ability of agents to perceive the environment, plan, and execute complex long-horizon activities that involve multiple objects, rooms, and state changes, all with the reproducibility, safety, and observability offered by a realistic physics simulation.',
    imageUrl: process.env.PUBLIC_URL + 'svl_robot.jpg', // Replace with path to your image
    linkUrl: 'https://www.google.com',
  },
  {
    id: 1,
    title: 'BEHAVIOR',
    description: 'BEHAVIOR is a benchmark in simulation where embodied AI agents need to plan and execute navigation and manipulation strategies based on sensor information to fulfill up to 1,000 household activities. BEHAVIOR tests the ability of agents to perceive the environment, plan, and execute complex long-horizon activities that involve multiple objects, rooms, and state changes, all with the reproducibility, safety, and observability offered by a realistic physics simulation.',
    imageUrl: process.env.PUBLIC_URL + 'svl_robot.jpg', // Replace with path to your image
    linkUrl: 'https://www.google.com',
  },
];

const ResearchPage = () => {
    return (
        <div className="research-page">
            <h1>Current Highlighted Projects</h1>
            <div className="projects-container">
                {researchProjects.map(project => (
                    <div key={project.id} className="project-card">
                        <img src={project.imageUrl} alt={project.title} className="project-image" />
                        <h2>{project.title}</h2>
                        <p>{project.description}</p>
                        <a href={project.linkUrl} target="_blank" rel="noopener noreferrer">Check out our Link.</a>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default ResearchPage;
